import React, {Component} from 'react'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import signIn from './Sign-In';

function App() {

    return(
      <div>
        <Router>
          <Switch>
            <Route exact path="/" component={ signIn}></Route>
          </Switch>
        </Router>
      </div>
    )
}

export default App;
